import React, { useState } from "react";
import { Routes } from 'react-router-dom'
import AdminPage from './components/Admin/AdminPage'
import Login from "./components/Login/Login"

const App = () => {
  return (
    <div>
      <Login>
        <Routes>
          <Route path="/AdminPage" element={<AdminPage />}></Route>
        </Routes>
      </Login>
    </div>
  );
};

export default App;
